import React from 'react'
import { useState } from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCog } from '@fortawesome/free-solid-svg-icons'
import './Setings.css'
const Setings = () => {
    const [seting, setSeting] = useState(false)

    const mouseHandler = () => {
        if(seting === false){
          setSeting(true)
        }else{
          setSeting(false)
        }
        console.log(seting)
      }


    return (
        <div className='fav-p' onMouseLeave={mouseHandler}>
            <div className='details'>
                <p className='temp-config'>Temperature<span className='celsius'>°C</span><span>°K</span></p>
                <p className='speed-config'>Speed<span>km/h</span><span>mph</span></p>
            </div>
        </div>

    )
}

export default Setings
